    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1660854677532,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1660854677537,"commentText":"In this program I will discuss how numbers work in Elixir. Then I will get into a little more detail about the match operator, <span style=\"font-family: Courier;\">=</span>.<br>","commentTitle":"","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"ev-46":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-46","timestamp":1660854705878,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":46,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-45","lineNumber":2,"column":22,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660855320322,"commentText":"Arithmetic with hard coded values works about how you would expect (see the attached screenshot).<br>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"IO.puts(1 + 2 + 3 + 4)\nIO.puts(1 * 2 * 3 * 4)","startRow":0,"startColumn":0,"endRow":1,"endColumn":22}],"imageURLs":["media/images/1662057326945-03.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/02.exs","viewableBlogText":"IO.puts(1 + 2 + 3 + 4)\nIO.puts(1 * 2 * 3 * 4)","commentTags":["successful-run","image"],"questionCommentData":null}],"ev-85":[{"id":"commentId-2","displayCommentEvent":{"id":"ev-85","timestamp":1660854745963,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":85,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-84","lineNumber":3,"column":38,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660855457693,"commentText":"<div>One interesting choice that the creator of Elixir made was to have integers that never overflow.&nbsp;As long as there is enough memory to hold the resulting calculations, there will never be an integer overflow.</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"IO.puts(12345 * 23456 * 34567 * 47890)","startRow":2,"startColumn":0,"endRow":2,"endColumn":38}],"imageURLs":["media/images/1662057309087-04.png"],"videoURLs":[],"audioURLs":[],"linesAbove":2,"linesBelow":0,"currentFilePath":"/02.exs","viewableBlogText":"IO.puts(1 + 2 + 3 + 4)\nIO.puts(1 * 2 * 3 * 4)\nIO.puts(12345 * 23456 * 34567 * 47890)","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-153":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-153","timestamp":1660854769062,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":153,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-152","lineNumber":5,"column":36,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660855599368,"commentText":"<div>Elixir uses <a href=\"https://en.wikipedia.org/wiki/Double-precision_floating-point_format\">64 bit floating point numbers</a> when you need non-integer numbers. Unlike integers, these have limits and you may lose some precision.</div><div><br></div><div>Notice in the attached screenshot that the last sum is a little bit off. This is typical when working with floating point numbers in almost all programming languages.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"IO.puts(1.0 + 2.0 + 3.0 + 4.0)\nIO.puts(0.1 + 0.02 + 0.003 + 0.0004)","startRow":3,"startColumn":0,"endRow":4,"endColumn":36}],"imageURLs":["media/images/1662057368518-05.png"],"videoURLs":[],"audioURLs":[],"linesAbove":3,"linesBelow":0,"currentFilePath":"/02.exs","viewableBlogText":"IO.puts(1 + 2 + 3 + 4)\nIO.puts(1 * 2 * 3 * 4)\nIO.puts(12345 * 23456 * 34567 * 47890)\nIO.puts(1.0 + 2.0 + 3.0 + 4.0)\nIO.puts(0.1 + 0.02 + 0.003 + 0.0004)","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-158":[{"id":"commentId-4","displayCommentEvent":{"id":"ev-158","timestamp":1660854810506,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":158,"type":"DELETE","fileId":"fileId-0","character":"0","previousNeighborId":"ev-147","lineNumber":5,"column":27},"developerGroupId":"devGroupId-2","timestamp":1660855690223,"commentText":"<div>When using hard coded floating point numbers at least one digit is required on both sides of the decimal point.&nbsp;<span style=\"font-family: Courier;\">0.1</span> is valid syntax but <span style=\"font-family: Courier;\">.1</span> is not.</div><div><br></div><div>The attached screenshot shows the error you get when you leave one out.&nbsp;</div><div><br></div><div>This means that you have to be careful when writing numbers like <span style=\"font-family: Courier;\">1.0</span>, <span style=\"font-family: Courier;\">-4.0</span>, <span style=\"font-family: Courier;\">0.0</span>, and so on.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":".1","startRow":4,"startColumn":8,"endRow":4,"endColumn":10},{"fileId":"fileId-0","selectedText":".02","startRow":4,"startColumn":13,"endRow":4,"endColumn":16},{"fileId":"fileId-0","selectedText":".003","startRow":4,"startColumn":19,"endRow":4,"endColumn":23},{"fileId":"fileId-0","selectedText":".0004","startRow":4,"startColumn":26,"endRow":4,"endColumn":31}],"imageURLs":["media/images/1662057403282-06.png"],"videoURLs":[],"audioURLs":[],"linesAbove":1,"linesBelow":0,"currentFilePath":"/02.exs","viewableBlogText":"IO.puts(1.0 + 2.0 + 3.0 + 4.0)\nIO.puts(.1 + .02 + .003 + .0004)","commentTags":["image"],"questionCommentData":null}],"ev-198":[{"id":"commentId-5","displayCommentEvent":{"id":"ev-198","timestamp":1660854851522,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":198,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-197","lineNumber":8,"column":15,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660855794063,"commentText":"<div>Whether you are using integers or floats in a division operation you always get back a float result.</div><div><br></div><div>Line 7 uses floats with a decimal point. Line 8 uses integers. Both lines involve a division operation. Both results will be floats (see the attached screenshot).</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"IO.puts(10.0 / 3.0)\nIO.puts(10 / 3)","startRow":6,"startColumn":0,"endRow":7,"endColumn":15}],"imageURLs":["media/images/1662057485142-07.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/02.exs","viewableBlogText":"IO.puts(10.0 / 3.0)\nIO.puts(10 / 3)","commentTags":["successful-run","image"],"questionCommentData":null}],"ev-239":[{"id":"commentId-6","displayCommentEvent":{"id":"ev-239","timestamp":1660854883343,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":239,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-238","lineNumber":11,"column":19,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660855923842,"commentText":"<div>If you would like a quotient or remainder then you use the built in <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/Kernel.html#div/2\">div</a></span> and <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/Kernel.html#rem/2\">rem</a></span> functions.</div><div><br></div><div>In other languages one might see something like this:<br></div><div><span style=\"font-family: Courier;\"><span style=\"font-family: Courier;\">//integer division (returns quotient)</span></span></div><div><span style=\"font-family: Courier;\"><span style=\"font-family: Courier;\"></span>10 / 3 == 3&nbsp;</span></div><div><span style=\"font-family: Courier;\"><br></span></div><div><span style=\"font-family: Courier;\">//modulus division (returns remainder)</span><span style=\"font-family: Courier;\"></span></div><div><span style=\"font-family: Courier;\">10 % 3 == 1&nbsp;<br></span></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"div(","startRow":9,"startColumn":8,"endRow":9,"endColumn":12},{"fileId":"fileId-0","selectedText":")","startRow":9,"startColumn":17,"endRow":9,"endColumn":18},{"fileId":"fileId-0","selectedText":"rem(","startRow":10,"startColumn":8,"endRow":10,"endColumn":12},{"fileId":"fileId-0","selectedText":")","startRow":10,"startColumn":17,"endRow":10,"endColumn":18}],"imageURLs":["media/images/1662057619090-08.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/02.exs","viewableBlogText":"IO.puts(div(10, 3))\nIO.puts(rem(10, 3))","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-282":[{"id":"commentId-7","displayCommentEvent":{"id":"ev-282","timestamp":1660854906702,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":282,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-281","lineNumber":14,"column":12,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660856060795,"commentText":"The <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/Integer.html\">Integer</a></span> module has a function to turn an integer into a string, <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/Integer.html#to_string/2\">to_string</a></span>.<br>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"str = Integer.to_string(123)\nIO.puts(str)","startRow":12,"startColumn":0,"endRow":13,"endColumn":12}],"imageURLs":["media/images/1662057845277-09.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/02.exs","viewableBlogText":"str = Integer.to_string(123)\nIO.puts(str)","commentTags":["successful-run","image"],"questionCommentData":null}],"ev-299":[{"id":"commentId-8","displayCommentEvent":{"id":"ev-299","timestamp":1660854929060,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":299,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-298","lineNumber":15,"column":15,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660856231484,"commentText":"The <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/IO.html\">IO</a></span> module's <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/IO.html#inspect/2\">inspect</a></span> function gives you a little more detail about a piece of data. This will be useful when I explain more complex data types later. Here, the quotes in the output tell me that this is a string.<br>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"IO.inspect(str)","startRow":14,"startColumn":0,"endRow":14,"endColumn":15}],"imageURLs":["media/images/1662057926765-10.png"],"videoURLs":[],"audioURLs":[],"linesAbove":2,"linesBelow":0,"currentFilePath":"/02.exs","viewableBlogText":"str = Integer.to_string(123)\nIO.puts(str)\nIO.inspect(str)","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-379":[{"id":"commentId-9","displayCommentEvent":{"id":"ev-379","timestamp":1660854972076,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":379,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-378","lineNumber":19,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660856370107,"commentText":"You can turn a string into an integer with the <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/String.html#to_integer/1\">to_integer</a></span> function in the <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/String.html\">String</a></span> module.<br>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"num = String.to_integer(\"123\")\n","startRow":16,"startColumn":0,"endRow":17,"endColumn":0}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":1,"currentFilePath":"/02.exs","viewableBlogText":"num = String.to_integer(\"123\")\nIO.puts(is_integer(num))\nIO.puts(is_number(num))","commentTags":[],"questionCommentData":null},{"id":"commentId-10","displayCommentEvent":{"id":"ev-379","timestamp":1660854972076,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":379,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-378","lineNumber":19,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660856667810,"commentText":"<div>There are several built in functions that will give you some information about the type of a piece of data (see the first attached screenshot of the Elixir docs).&nbsp;</div><div><br></div><div>Here I show <span style=\"font-family: Courier;\">is_integer</span> and <span style=\"font-family: Courier;\">is_number</span>.&nbsp;Both return a true/false value. The latter will return true if the passed in parameter is <span style=\"font-style: italic;\">either</span> an integer or a floating point number.</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"is_integer(","startRow":17,"startColumn":8,"endRow":17,"endColumn":19},{"fileId":"fileId-0","selectedText":")","startRow":17,"startColumn":22,"endRow":17,"endColumn":23},{"fileId":"fileId-0","selectedText":"is_number(","startRow":18,"startColumn":8,"endRow":18,"endColumn":18},{"fileId":"fileId-0","selectedText":")","startRow":18,"startColumn":21,"endRow":18,"endColumn":22}],"imageURLs":["media/images/1662058096841-16.png","media/images/1662058103663-11.png"],"videoURLs":[],"audioURLs":[],"linesAbove":1,"linesBelow":0,"currentFilePath":"/02.exs","viewableBlogText":"num = String.to_integer(\"123\")\nIO.puts(is_integer(num))\nIO.puts(is_number(num))","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-400":[{"id":"commentId-11","displayCommentEvent":{"id":"ev-400","timestamp":1660855009128,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":400,"type":"INSERT","fileId":"fileId-0","character":"0","previousNeighborId":"ev-399","lineNumber":17,"column":28,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1660856809284,"commentText":"<div>There is also a <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/String.html#to_float/1\">to_float</a></span> function in the <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/String.html#content\">String</a></span> module. The string must include a digit on either side of the decimal point just like a true floating point number.<span style=\"font-family: Courier;\"></span></div><div><span style=\"font-family: Courier;\"><br></span></div><div><span style=\"font-family: Courier;\">num</span> not an integer any more (it is a float) but it is a number. So, the call on line 18 will return false but on line 19 it will return true. See the attached screenshot.<br></div><div></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"String.to_float(\"123.0\")","startRow":16,"startColumn":6,"endRow":16,"endColumn":30},{"fileId":"fileId-0","selectedText":"is_integer(num)","startRow":17,"startColumn":8,"endRow":17,"endColumn":23},{"fileId":"fileId-0","selectedText":"is_number(num)","startRow":18,"startColumn":8,"endRow":18,"endColumn":22}],"imageURLs":["media/images/1662121676303-12.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/02.exs","viewableBlogText":"num = String.to_float(\"123.0\")\nIO.puts(is_integer(num))\nIO.puts(is_number(num))","commentTags":["successful-run","image"],"questionCommentData":null}],"ev-566":[{"id":"commentId-12","displayCommentEvent":{"id":"ev-566","timestamp":1660855038528,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":566,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-565","lineNumber":25,"column":89,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660857289449,"commentText":"<div>Here is some pretty typical looking code to calculate the number of years until someone can retire.&nbsp;</div><div><br></div><div>Notice that it looks like I am creating some variables and assigning them some values. If this was a program in Ruby then there would be no need to explain any further.&nbsp;</div><div><br></div><div>However, in Elixir, the <span style=\"font-family: Courier;\">=</span> is not an assignment operator. It attempts to make a 'match'.<br></div>","commentTitle":"The Match Operator","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"age = 49\nretirement_age = 67\nyears_until_retirement = retirement_age - age","startRow":20,"startColumn":0,"endRow":22,"endColumn":45},{"fileId":"fileId-0","selectedText":"age","startRow":24,"startColumn":25,"endRow":24,"endColumn":28},{"fileId":"fileId-0","selectedText":"years_until_retirement","startRow":24,"startColumn":41,"endRow":24,"endColumn":63}],"imageURLs":["media/images/1662121746346-13.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/02.exs","viewableBlogText":"age = 49\nretirement_age = 67\nyears_until_retirement = retirement_age - age\n\nIO.puts(\"At the age of #{age} you have #{years_until_retirement} years until retirement\")","commentTags":["image","successful-run"],"questionCommentData":null},{"id":"commentId-13","displayCommentEvent":{"id":"ev-566","timestamp":1660855038528,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":566,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-565","lineNumber":25,"column":89,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660858123822,"commentText":"<div>If Elixir was a person they would ask, \"What do I have to do to make the statement on line 21 evaluate to&nbsp;true?\"<br><br>In this case, the answer is to bind a name, <span style=\"font-family: Courier;\">age</span>, to a value, <span style=\"font-family: Courier;\">49</span>. This makes the two 'things', a name and a value, <span style=\"font-style: italic;\">match</span>.</div><div><br></div><div>Every time that the <span style=\"font-family: Courier;\">=</span> operator is used, Elixir tries to find a way to make the two sides equal to each other.&nbsp;</div><div><br></div><div>If there is a name of the <span style=\"font-style: italic;\">left hand side</span> of the <span style=\"font-family: Courier;\">=</span> then it can bind a new value to the name. In other words, rebinding is possible.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"age = 49","startRow":20,"startColumn":0,"endRow":20,"endColumn":8}],"imageURLs":["media/images/1662121952012-01.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/02.exs","viewableBlogText":"age = 49","commentTags":["image"],"questionCommentData":null}],"ev-571":[{"id":"commentId-14","displayCommentEvent":{"id":"ev-571","timestamp":1660855083753,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":571,"type":"INSERT","fileId":"fileId-0","character":"0","previousNeighborId":"ev-570","lineNumber":21,"column":8,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1660858573681,"commentText":"<div>Here is another match. How will Elixir make this evaluate to true? It will bind the value 50 to the name <span style=\"font-family: Courier;\">age</span>.</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"age = 50","startRow":20,"startColumn":0,"endRow":20,"endColumn":8}],"imageURLs":["media/images/1662121991778-02.jpeg","media/images/1662122006449-14.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/02.exs","viewableBlogText":"age = 50","commentTags":["successful-run","image"],"questionCommentData":null}],"ev-580":[{"id":"commentId-15","displayCommentEvent":{"id":"ev-580","timestamp":1660855113277,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":580,"type":"INSERT","fileId":"fileId-0","character":"e","previousNeighborId":"ev-579","lineNumber":27,"column":8,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660858759413,"commentText":"<div>For more proof that the <span style=\"font-family: Courier;\">=</span> is a match and not an assignment operator, like in other languages, take a look at line 27. This is perfectly acceptable in Elixir.</div><div><br></div><div>Elixir will look at this line and say, \"What do I have to do to make this evaluate to true?\"</div><div><br></div><div>Elixir doesn't have to do anything because the value 50 is already bound to the name <span style=\"font-family: Courier;\">age</span> (it was bound on line 21). Nothing really changes or happens but Elixir is happy because it could make a match.</div><div><br></div><div>It may be hard to see how this is different from any other language's \nassignment operator. It has to do with the fact that data is immutable \nin Elixir.&nbsp;If you don't quite see how this can be used I will cover many\n more examples of this in future programs.</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"50 = age","startRow":26,"startColumn":0,"endRow":26,"endColumn":8}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/02.exs","viewableBlogText":"50 = age","commentTags":["successful-run"],"questionCommentData":null}],"ev-582":[{"id":"commentId-16","displayCommentEvent":{"id":"ev-582","timestamp":1660855129370,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":582,"type":"DELETE","fileId":"fileId-0","character":"0","previousNeighborId":"ev-574","lineNumber":27,"column":2},"developerGroupId":"devGroupId-2","timestamp":1660859130194,"commentText":"<div>Line 27 has one last change to the code. Now, Elixir asks, \"What do I have to do to make this true?\"</div><div><br></div><div>It turns out that it can't do anything to make it true. The name <span style=\"font-family: Courier;\">age</span> is bound to the value 50 and that is not equal to 5. Elixir will only rebind a name if it is on the left hand side of the match operator.<br></div><div><br></div><div>The attached screenshot shows the error message that is displayed when I tried to run this code.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"age = 50","startRow":20,"startColumn":0,"endRow":20,"endColumn":8},{"fileId":"fileId-0","selectedText":"5 = age","startRow":26,"startColumn":0,"endRow":26,"endColumn":7}],"imageURLs":["media/images/1662122193519-15.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/02.exs","viewableBlogText":"age = 50\nretirement_age = 67\nyears_until_retirement = retirement_age - age\n\nIO.puts(\"At the age of #{age} you have #{years_until_retirement} years until retirement\")\n\n5 = age","commentTags":["image"],"questionCommentData":null}]};
